function App() {
  return (
    <div className="App">
  <Navbar expand="lg" variant="light" bg="light">
    <Container>
      <Navbar.Brand href="#">Navbar</Navbar.Brand>
    </Container>
  </Navbar>



    </div>
  );
}

export default App;
